DROP TABLE IF EXISTS `worktable`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `worktable` (
  `worktableID` varchar(20) NOT NULL COMMENT '工单编号',
  `workunit` varchar(20) NOT NULL COMMENT '单位',
  `sendperson` varchar(20) DEFAULT NULL COMMENT '发令人',
  `acceptperson` varchar(20) DEFAULT NULL COMMENT '受令人',
  `starttime` datetime DEFAULT NULL COMMENT '操作开始时间',
  `endtime` datetime DEFAULT NULL COMMENT '操作结束时间',
  `sendtime` datetime DEFAULT NULL COMMENT '发令时间',
  `issupervised` tinyint(1) DEFAULT NULL COMMENT '监护下操作',
  `isaperson` tinyint(1) DEFAULT NULL COMMENT '单人操作',
  `isoverhaul` tinyint(1) DEFAULT NULL COMMENT '检修人操作',
  `operationtask` varchar(255) DEFAULT NULL COMMENT '操作任务',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `operationperson` varchar(255) DEFAULT NULL COMMENT '操作人',
  `supervisor` varchar(20) DEFAULT NULL COMMENT '监护人',
  `dutyperson` varchar(20) DEFAULT NULL COMMENT '值班负责人（值长）',
  `ocrimgsrc` varchar(255) DEFAULT NULL COMMENT '工单图片路径',
  `faceimgsrc` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`worktableID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

